import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import Landing from './pages/Landing';
import './App.css';

function App() {
  return (
    <Switch> 
      <Router>
        <Route exact path='/' component={Landing} />
      </Router>
    </Switch>
  );
}

export default App;
